children.onClick:
{{
	(function(){
		if(appsmith.store.vayApplicantJurisdiction === "IND"){
			if(appsmith.store.vayApplicationIndConstitutionType === "proprietorship"){
				navigateTo('Entity KYC Ind Proprietorship',{})
			}
			else if (appsmith.store.vayApplicationIndConstitutionType === "partnership"){
				navigateTo('Entity KYC Ind Partnership',{})
			}
			else if (appsmith.store.vayApplicationIndConstitutionType === "LLP"){
				navigateTo('Entity KYC Ind LLP',{})
			}
			else if (appsmith.store.vayApplicationIndConstitutionType === "PLC" || appsmith.store.vayApplicationIndConstitutionType === "LLC" ){
				navigateTo('Entity KYC Ind Company',{})
			}
		}
		else {
			navigateTo('Entity KYC Foreign',{})
		}
	})()
}}
